import React from "react";
import { Map, Marker, GoogleApiWrapper, GoogleAPI } from "google-maps-react";

interface MapComponentProps {
  google: GoogleAPI;
}
const MapComponent: React.FC<MapComponentProps> = ({ google }) => {
  const mapStyles = {
    width: "100%",
    height: "100%",
    position: "static",
  };
  const center = {
    lat: 47.444,
    lng: -122.176,
  };
  return (
    <div className="map-area">
      <Map
        style={mapStyles}
        google={google}
        center={{
          lat: 47.444,
          lng: -122.176,
        }}
      />
      <Marker key={1} position={center} />
    </div>
  );
};

export default GoogleApiWrapper({
  apiKey: "AIzaSyDMnu3kPUVDvMjDpLjAbdOvuzx6pHaZPXg",
})(MapComponent);
